import React, {Component} from 'react';
import './InfoBox.css';

class InfoBox extends Component{

    constructor(props){
        super(props);
    }



    render(){

        return(
            <div className="Info">
                <h2> Reporting Cases of COVID-19 </h2>
                <h4>{props.nowState}</h4>
            </div>
        );
    }

}

export default InfoBox;
